import { library } from '@fortawesome/fontawesome-svg-core'
import {faLightbulb,faInfoCircle,faUser, faCog, faBell, faComments, faCheckCircle, faFileAlt, faPaste, faArrowLeft, faLock} from '@fortawesome/free-solid-svg-icons'

library.add(faUser, faCog, faBell, faComments, faCheckCircle, faFileAlt, faPaste, faArrowLeft,faInfoCircle,faLightbulb, faLock);
